import './cssKontakt/kontakt.css';
import './cssKontakt/media-kontakt.css';
export default class sekcijaKontakt extends Component {
	render() {
		return (
			<React.Fragment className="kontakt">
				<p>kontakt</p>
			</React.Fragment>
		);
	}
}
